// this is a component for rendering one song
// we will use the instance of it to render as many songs as we want
// from resultSongs variable
import React from 'react';

// id il vom da dintro functie
// primeste 2 props de la parent SearchResults, song obiect, id de la functie
/*
  song = {
    id : number de la functie
    title : 
    album:
    preview: src
  }
*/


function Songs ({song}){
    return(
        <li>
            <p>{song.id}{song.title}{song.album}</p>
            <audio controls src={spreview} ></audio>
            <button>+</button>
        </li>
    );
}

export default Songs;
